import logo from "./logo.svg";

import "./vendors/bootstrap/bootstrap.min.css";
import "./vendors/fontawesome/css/all.min.css";
import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import SignUp from "./components/screens/signup.js";
import Login from "./components/screens/login.js";
import Profile from "./components/screens/profile.js";
import MemesSearch from "./components/screens/meme-search.js";
import Home from "./components/screens/home.js";
import { ProfileProvider } from "./components/contexts/profile-context";
import SecureRoute from "./components/secure-route.js";
import MemeDetails from "./components/screens/meme-details.js";
import NavigationSidebar from "./components/navbar";
import { ChakraProvider } from "@chakra-ui/provider";

function App() {
  return (
    <div className="container">
      <ProfileProvider>
        <ChakraProvider>
          <BrowserRouter>
            <div className="row">
              <div className="col-2">
                <NavigationSidebar />
              </div>
              <div className="col-8">
                <Routes>
                  <Route path="/">
                    <Route index element={<Home />} />
                    <Route path="signup" element={<SignUp />} />
                    <Route path="login" element={<Login />} />
                    <Route
                      path="profile"
                      element={
                        <SecureRoute>
                          <Profile />
                        </SecureRoute>
                      }
                    />
                    <Route path="meme-search" element={<MemesSearch />} />
                    <Route
                      path="meme-search/:memeSearch"
                      element={<MemesSearch />}
                    />
                    <Route path="details/:memeID" element={<MemeDetails />} />
                  </Route>
                </Routes>
              </div>
            </div>
          </BrowserRouter>
        </ChakraProvider>
      </ProfileProvider>
    </div>
  );
}

export default App;
